import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css"
import { BrowserRouter as Router, Route } from "react-router-dom";


import  Navbar from "./components/navbar.component";
import  project from "./components/project.component";
import  issue from "./components/issue.component";
import  newIssue from "./components/newIssue.component";
import  deleteIssue from "./components/deleteIssue.component";


function App() {
  return (
    <Router>
      <div className="container">
  <Navbar />
  <br />
  <Route path="/" exact component={project} />
  <Route path="/issues" component={issue} />
  <Route path="/newissue"  component={newIssue} />
  <Route path="/deleteissue"  component={deleteIssue} />
      </div>
    </Router>


  );
}

export default App;
